caption:
b'This image, taken on the SIGNA Premier, shows the complex, interconnected fiber tracks of the brain. Scientists at the University of Wisconsin\xe2\x80\x93Madison are using SIGNA Premier, a new MRI system, that can enable them to see the brain better than ever before with visibility of the smallest details. They can now map the complete structural and functional neural connections in the brain to better understand and treat disease. Learn more about this research and the researchers behind it all at the link in our bio. Image courtesy of Alan McMillan, PhD, Wisconsin Institutes for Medical Research, Department of Radiology, University of Wisconsin \xe2\x80\x93 Madison.

